import React from "react";
import "./App.css";
import DataForm from "./components/DataForm";
import { Button } from "react-bootstrap";

function App() {
  return (
    <div className="App" style={{ display: "flex", justifyContent: "center" }}>
      <Button style={{ width: "25rem" }}>Back</Button>
      <DataForm />
    </div>
  );
}

export default App;
